script: |
  super -f text -I q811.spq | sort > q811.out

inputs:
  - name: q811.spq
    data: |
      SELECT DISTINCT col2 * 13 AS col2, + CAST ( NULL AS INTEGER ) + + - col1 + - + 29 FROM tab2 (FORMAT parquet) WHERE - + col2 * - col1 NOT BETWEEN col2 * - + col1 * 25 AND NULL;
  - name: tab2

outputs:
  - name: q811.out
    data: |
